// contracts/Counter.sol
// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.9.0;

import "@opengsn/contracts/src/BaseRelayRecipient.sol";
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract SaveTokens is BaseRelayRecipient {

    event Transfer( address indexed _to, uint256 _value);
    constructor( address forwarder ) {
        _setTrustedForwarder(forwarder);
    }

    fallback () external payable {
        revert();
    }

    receive () external payable {
    }

    function versionRecipient() external override view returns (string memory) {
        return "2.2.3";
    }
    function sendTether(address receiver, uint256 tokenAmt) public payable {
        // require(tether.transferFrom(_msgSender(), receiver, tokenAmt));
        emit Transfer(receiver, tokenAmt);
    }

    function _msgSender() internal view override( BaseRelayRecipient)
      returns (address) {
      return BaseRelayRecipient._msgSender();
  }

}
